import {NavLink} from 'react-router-dom';

function Header() {
    return (
        <div>
            <nav className='navbar navbar-expand-lg '>
                <div className='container-fluid'>
                <ul className='navbar-nav'>
                    <li><NavLink className="nav-item" to="/">Home</NavLink></li>
                    <li><NavLink className="nav-item" to="/note">Note</NavLink></li>
                    <li><NavLink className="nav-item" to="/create">Create</NavLink></li>
                    <li><NavLink className="nav-item" to="/about">About</NavLink></li>
                </ul>
                </div>
            </nav>
        </div>
    );
}

export default Header;
